// src/components/AdminOptions.js
import React from 'react';
import '../../CSS/AdminOptions.css';



const AdminOptions = ({ onManageEditors, onManageViewers, onLogout }) => (
  <div className="admin-options">
    <h2>Admin Options</h2>
    <ul className="options-list">
      <li>
        <button className="btn btn-manage-editors" onClick={onManageEditors}>Manage Editors</button>
      </li>
      <li>
        <button className="btn btn-manage-viewers" onClick={onManageViewers}>Manage Viewers</button>
      </li>
      <li>
        <button className="btn btn-logout" onClick={onLogout}>Logout</button>
      </li>
    </ul>
  </div>
);
reloadCSS();
export default AdminOptions;
function reloadCSS() {
    const link = document.querySelector('link[rel="stylesheet"]');
    if (link) {
        const newLink = link.cloneNode();
        newLink.href = link.href.split('?')[0] + '?v=' + new Date().getTime();
        link.parentNode.replaceChild(newLink, link);
    }
  }
